import React from "react";
import { useLocation, Link } from "react-router-dom";

export default function JobResults() {
  const location = useLocation();
  const data = location.state?.data;

  const container = { padding: "40px", fontFamily: "Arial, sans-serif", background: "#fbfcff", minHeight: "100vh" };
  const card = { background: "#fff", padding: "22px", borderRadius: "10px", boxShadow: "0 6px 16px rgba(20,30,50,0.06)", maxWidth: "900px", margin: "0 auto" };
  const row = { display: "flex", gap: "12px", marginBottom: "10px", flexWrap: "wrap" };
  const label = { width: "220px", fontWeight: 600, color: "#223249" };
  const value = { color: "#334e68" };

  if (!data) {
    return (
      <div style={container}>
        <div style={card}>
          <h2>No data found</h2>
          <p>It looks like you landed here without submitting the form.</p>
          <Link to="/part-time-jobs">Go back to Part-time Jobs form</Link>
        </div>
      </div>
    );
  }

  return (
    <div style={container}>
      <div style={card}>
        <h2 style={{ marginBottom: "10px" }}>Your Submitted Job Preferences</h2>
        <p style={{ marginBottom: "18px", color: "#4b5563" }}>Below is a summary of the preferences you just submitted — we'll use these to find suitable part-time roles for you.</p>

        <div style={row}><div style={label}>Preferred Location:</div><div style={value}>{data.preferredLocation}</div></div>
        <div style={row}><div style={label}>Preferred Job Role:</div><div style={value}>{data.preferredJobRole}</div></div>
        <div style={row}><div style={label}>Preferred Time:</div><div style={value}>{data.preferredTime === "custom" ? data.customPreferredTime || "Custom" : data.preferredTime}</div></div>
        <div style={row}><div style={label}>Salary Expectation:</div><div style={value}>{data.salaryExpectation ? `₹ ${data.salaryExpectation}` : "-"}</div></div>

        <div style={row}><div style={label}>Qualification:</div><div style={value}>{data.qualification}</div></div>
        <div style={row}><div style={label}>Nationality:</div><div style={value}>{data.isIndian === "yes" ? "Indian" : data.country || "Not specified"}</div></div>
        <div style={row}><div style={label}>Student:</div><div style={value}>{data.isStudent === "yes" ? `Yes — ${data.collegeName} (ID: ${data.collegeIdNumber})` : "No"}</div></div>
        <div style={row}><div style={label}>Age:</div><div style={value}>{data.age}</div></div>
        <div style={row}><div style={label}>Night Shift OK:</div><div style={value}>{data.comfortableNightShift === "yes" ? "Yes" : "No"}</div></div>

        <div style={{ marginTop: "18px" }}>
          <h4 style={{ marginBottom: "8px" }}>Uploaded Files</h4>
          <div style={{ color: "#556" }}>
            <div>College ID File: {data.collegeIdFileName || "—"}</div>
            <div>Resume File: {data.resumeFileName || "—"}</div>
          </div>
        </div>

        <div style={{ marginTop: "18px", display: "flex", gap: "12px" }}>
          <Link to="/part-time-jobs" style={{ padding: "10px 14px", background: "#eef2ff", borderRadius: "8px", color: "#0b6bff", textDecoration: "none" }}>Edit Preferences</Link>
          <Link to="/" style={{ padding: "10px 14px", background: "#0b6bff", color: "#fff", borderRadius: "8px", textDecoration: "none" }}>Back to Home</Link>
        </div>
      </div>
    </div>
  );
}
